import React from 'react';
import './Card.css'

const card = () => {
    return(
        <div className='bg-light-gray dib pa3 ma2 grow'>
            <img alt='charaters' src='https://www.themainstreetmouse.com/wp-content/uploads/2017/12/https_2F2Fblueprint-api-production.s3.amazonaws.com2Fuploads2Fcard2Fimage2F6166162F00b648f5-ae81-488e-8f71-892211a1dff1.jpg?200x200'></img>
            <h2>starwars</h2>
            <p>star crew</p>
        </div>
    )
}

export default card;
